import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Card from "./components/Card";

export default function App() {
    const firstName = "Joe";
    const lastName = "Schmoe";
    const date = new Date();
    return (
        <div>
            <Navbar />
            <Hero />
            <Card />
            <h1>It is currently about {date} o'clock</h1>
        </div>
    )
}
